class Solution {
public:
    int lengthOfLongestSubstring(string s) {
        if(s.size() < 1)
            return 0;
        const char* strInput = s.c_str();
        int nMax = 1;
        int nHead = 0;
        int nTail = 1;
        int nMaxLen = 1;
        int chInputs[1000] = {0};
       // memset(chInputs,0, 10000*sizeof(int));
        chInputs[strInput[nHead]] = nHead + 1;
        int nlen = s.size();
        for(;nTail<nlen; nTail++) {
            if(chInputs[strInput[nTail]] == 0
               || chInputs[strInput[nTail]] < nHead + 1) {
                chInputs[strInput[nTail]] = nTail + 1;
                nMaxLen ++;
            } else {
                   int m = chInputs[strInput[nTail]] - 1;
                    chInputs[strInput[nTail]] = nTail + 1;
                    if(nMaxLen > nMax)
                        nMax = nMaxLen;
                    nMaxLen = nTail - m;
                    if(nlen - nTail + nMaxLen < nMax)
                        return nMax;
                   nHead = m + 1;
            }
        }
        if(nMaxLen > nMax)
            nMax = nMaxLen;        return nMax;
        
    }
};

string& getInput()
{
	char strinput[100];
	scanf("%s", strinput);
	string* input = new string(strinput);
	return *input;
}

